import React from 'react';
import Carousel from 'react-bootstrap/Carousel';


function MainSlider() {
  return (
      <div className="slider">
        <Carousel>
          <Carousel.Item>
          <ParallaxBanner
    className="your-class"
    layers={[
        {
            image: 'https://foo.com/foo.jpg',
            amount: 0.1,
        },
        {
            image: 'https://foo.com/bar.png',
            amount: 0.2,
        },
    ]}
    style={{
        height: '500px',
    }}
>
    <h1>Banner Children</h1>
</ParallaxBanner>
          </Carousel.Item>
          <Carousel.Item>
            <img
            className="d-block w-100"
            src="/images/03slide.png"
            alt="Third slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
            className="d-block w-100"
            src="/images/14slide.png"
            alt="Third slide"
            />
          </Carousel.Item>
        </Carousel>
      </div>
  );
}

export default MainSlider;
